import './App.css';

const InputSection = ({InputName, DisplayName}) => {
    return(
        <div className = 'InputSection'>
            <h2>{DisplayName}</h2>
            <input name = {InputName} className = 'InputBox' />
        </div>
    );
}

const TextInput = () => {

    return (
        <div className='TextInput'>
            <InputSection InputName={"Latitude"} DisplayName={"קו אורך"} />
            <InputSection InputName={"Longitude"} DisplayName={"קו רוחב"} />
            <InputSection InputName={"Radius"} DisplayName={"רדיוס טיסה"} />
            <InputSection InputName={"Speed"} DisplayName={"מהירות"} />
        </div>
    );

}

export default TextInput;
